        private SeriesList ReadFile(string filename)
        {
            SeriesList seriesList = new SeriesList();

            TextFile tf = new TextFile(filename);

            var idx = tf.IndexOf("Message for Platform");

            if (idx < 0 || tf.Length < idx + 2)
            {
                Logger.WriteLine("Error reading '" + filename + "'");
            }

            var tokens = tf[idx + 1].Split('|');
            var units = tf[idx + 3].Split('|');

            for (int i = 1; i < tokens.Length; i++)
            {
                var s = new Series();
                string name = tokens[i].Trim();
                string unit = units[i].Trim();
                if (name != "")
                {
                    s.Name = name;
                    s.Units = unit;
                    for (int j = 5; j < tf.Length; j++)
                    {
                        var rval = tf[j].Split('|');
                        //index 0 hard coded as place for date
                        s.Add(Convert.ToDateTime(rval[0].Trim()), Convert.ToDouble(rval[i].Trim()));
                    }
                    seriesList.Add(s);
                }
            }
            return seriesList;

        }
        private static void Route(string cbtt, string pcode, Series s)
        {
            Console.WriteLine("Processing " + cbtt + "_" + pcode + " " + s.Count + " records");
            TimeSeriesRouting.RouteInstant(s, cbtt, pcode, RouteOptions.Outgoing);
        }

        public Series[] GetSeries()
        {
            
            ReadFile(filename);

            return seriesList.ToArray();
        }

